import React from "react";
import Projects from "../Projects"
import portrait from "../../assets/images/self-portrait-sqr.jpg"


const Works = () => (
  <div>
    <h1>Works Page</h1>
    <h2>Learn About My Design Process and Work</h2>
    <img src={portrait} alt="Design Portfolio"></img>

  <h2>View Web Projects</h2>
  <Projects/>

  </div>
);

export default Works;
